function loadgame(index) {
    $('#boot').hide()
    $('#sim').show()
    current = index
    loadset(index)
    $('body').keyup(function (e) {
        if (e.which == 188) {
            if (ongoing) return
                loadset(current == 1 ? 1 : --current)
                gen = 0
                $('#gen').html(0)
            return
        }
        else if (e.which == 190) {
            if (ongoing) return
            loadset(current == 6 ? 6 : ++current)
            gen = 0
            $('#gen').html(0)
            return
        }
        ongoing = !ongoing
        if (ongoing) {
            playgame()
        }
    })
    $('#game').mousedown(function (e) {
        if (ongoing) return
        if (e.offsetX) {
            x = e.offsetX
            y = e.offsetY
        }
        else if (e.layerX) {
            x = e.layerX
            y = e.layerY
        }
        x = Math.floor(x / 9 + 1)
        y = Math.floor(y / 9)
        var state = odd ? grida[y][x] : gridb[y][x]
        if (state == "e") return
        if (odd) {
            grida[y][x] = !state
        }
        else {
            gridb[y][x] = !state
        }
        drawdot(y,x,!state)
    })
}